    false,nt"url": null,nt"notes": "This data set is a part of Ecotrust's project
    entitled: Establishing a Baseline and Assessing Spatial and Socioeconomic Change
    in the California Central Coast Commercial and CPFV Fisheries. This project is a
    component of the California Central Coast Marine Protected Area Baseline Monitoring
    Project that is designed to characterize the ecological and socioeconomic conditions
    and changes within the Central Coast Region since MPA implementation. The Central
    Coast study region extends from the north at Pigeon Point to the south at Point
    Conception. This dataset consists of data collected in the spring of 2012 from fisheries
    mapping interviews with commercial passenger fishing vessel (CPFV) captains. Interviews
    were conducted with CPFV captains in the following ports: Santa Cruz, Moss Landing,
    Monterey, Morro Bay, and Avila-Port San Luis in the Central Coast Region. Results
    from the interviews were then combined through an aggregation process where the
    stated value each fisherman gives to their fishery specific fishing grounds are
    weighted by percent gross economic revenue earned from that fishery for in 2011.
    This dataset represents the spatial extent and relative value of salmon CPFV fishing
    grounds for the Central Coast Region in the year 2011.",nt"license_title":
